import { AdminForm } from '../representational/AdminForm.jsx'

export function AdminFormContainer(props) {

    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    
    function handleChange(event) {
        
        if ((e.target.value).length !== 0) {
            setEmail(event.target.value);
            setPassword(event.target.value);
        }

    }

    function handleSubmit(event) {
        event.preventDefault();
        props.setAccess(true)
        console.log('submit_handled');
    }
    
    return (
        <AdminForm email={email} password={password} onSubmit={handleSubmit} onChange={handleChange} />
    );
    
}
